import React from "react";



export default function Joke(props) {
 if (!props.Setup) {
  return (
  <h4>Punchline   {props.Punchline}</h4>
  )
 } else {
 return (
   <>
     <h4>Want to hear a joke? :  {props.Setup}</h4>
     <h4>Punchline :  {props.Punchline}</h4>
   </>
 );
}}
